CommonData.BannerCustomCSS:
#onetrust-consent-sdk {
  z-index: 999999;
}

#onetrust-consent-sdk #onetrust-banner-sdk {
  border-radius: 4px;
}

#onetrust-consent-sdk.otFlat #onetrust-banner-sdk {
  border-radius: 0;
}

#onetrust-banner-sdk p,
#onetrust-pc-sdk p,
#ot-sdk-cookie-policy p {
  margin-bottom: 1em !important;
}

body #onetrust-banner-sdk #onetrust-button-group-parent {
  padding: 10px 30px 24px 30px;
}

body #onetrust-banner-sdk a,
body #onetrust-banner-sdk a:visited {
  color: white;
}

body #onetrust-banner-sdk #onetrust-policy-text {
  padding-right: 80px;
  padding-top: 5px;
  line-height: 22px;
  font-size: 14px;
  letter-spacing: 0.5px;
}

body #onetrust-consent-sdk #onetrust-banner-sdk a[href] {
  color: white;
  mix-blend-mode: difference;
}

#onetrust-banner-sdk div div#onetrust-close-btn-container {
  display: block;
  width: 32px;
  height: 32px;
  top: 30px;
  right: 30px;
  mix-blend-mode: difference;
}

#onetrust-banner-sdk div div#onetrust-close-btn-container button.ot-close-icon {
  background: none;
  position: relative;
  display: block;
  margin: 0;
  width: 100%;
  height: 100%;
  right: auto;
  border: 1px solid white;
  border-radius: 3px;
}

#onetrust-banner-sdk div div#onetrust-close-btn-container button.ot-close-icon:before,
#onetrust-banner-sdk div div#onetrust-close-btn-container button.ot-close-icon:after {
  content: "";
  display: block;
  background: white;
  width: 60%;
  height: 1px;
  transform-origin: center;
  position: absolute;
  left: 50%;
  top: 50%;
  margin-left: -30%;
}

#onetrust-banner-sdk div div#onetrust-close-btn-container button.ot-close-icon:before {
  transform: rotate(-45deg);
}

#onetrust-banner-sdk div div#onetrust-close-btn-container button.ot-close-icon:after {
  transform: rotate(45deg);
}

@media only screen and (min-width: 1024px) {
  #onetrust-banner-sdk.otFlat div div#onetrust-close-btn-container {
    border: none;
    top: 50%;
    right: 0;
    transform: translate(-50%, -70%);
  }
}

@media only screen and (min-width: 426px) and (max-width: 896px) {
  #onetrust-banner-sdk.otFlat div div#onetrust-close-btn-container button.ot-close-icon {
    top: 0;
    right: 0;
  }
}

#onetrust-pc-sdk .ot-btn-container {
  padding-bottom: 25px !important;
}

#onetrust-pc-sdk .ot-pc-footer-logo {
  display: none !important;
}

#onetrust-banner-sdk #onetrust-reject-all-handler {
  background-color: #151b26;
  color: #fff;
  border: 1px solid white;
}

